function parseData(data){
  data = JSON.parse(data);
  let processed_data = [];
  for( let [key,line] in Object.entries(data['data'])){
        let lineA = line.map(function (coordinate) {
            let tmp = coordtransform.gcj02towgs84(coordinate[1],coordinate[0])
            return [tmp[1],tmp[0]]
        });
        processed_data.push(lineA);
    }
    data['data'] = processed_data;
  data['budget'] = data['budget'].sort();
  console.log(data);
  return data;
}
function parseData2(data){
      console.log(data);

  let processed_data = {};
  for( let [edgeId,line] of Object.entries(data['data'])){
        let lineA = line.map(function (coordinate) {
            let tmp = coordtransform.gcj02towgs84(coordinate[0],coordinate[1])
            return [tmp[1],tmp[0]]
        });
        processed_data[edgeId] = lineA;
    }
    data['data'] = processed_data;
  return data;
}

